svg.script:
 /*  */

var currentColor=0;
var svgDoc;
var UTCOffset=1;
var TZOffset=6;
var functions=new Array('time','al','date','chr','tm','tz','al2','utc','blank');
var currentFunction=7;
var angleLunette=0;
var stopLunette=1;

function initialiser(event){
	//svgDoc  = event.getTarget().getOwnerDocument();
	svgDoc=event.target.ownerDocument;
	setTimeout("rotateAiguilles()",200);

	// Passage au bleu
	currentColor++;
	changeColor();
}

function changeColor(){
	currentColor++;
	if(currentColor>2)
		currentColor=0;
	if(currentColor=="0"){
		// Gris
		svgDoc.getElementById('couleurCadranInterne').setAttribute('style','fill: #555;');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(0).setAttribute('stop-color','#333');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(1).setAttribute('stop-color','#555');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(2).setAttribute('stop-color','#888');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(3).setAttribute('stop-color',svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(1).getAttribute('stop-color'));
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(4).setAttribute('stop-color',svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(0).getAttribute('stop-color'));
	}else if(currentColor=="1"){
		// Noir
		svgDoc.getElementById('couleurCadranInterne').setAttribute('style','fill: #2d2d2d;');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(0).setAttribute('stop-color','#1e1e1e');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(1).setAttribute('stop-color','#2d2d2d');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(2).setAttribute('stop-color','#666');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(3).setAttribute('stop-color',svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(1).getAttribute('stop-color'));
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(4).setAttribute('stop-color',svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(0).getAttribute('stop-color'));
	}else if(currentColor=="2"){
		// Bleu
		svgDoc.getElementById('couleurCadranInterne').setAttribute('style','fill: #1D3D69;');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(0).setAttribute('stop-color','#0B2344');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(1).setAttribute('stop-color','#1B365C');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(2).setAttribute('stop-color','#396DB5');
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(3).setAttribute('stop-color',svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(1).getAttribute('stop-color'));
		svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(4).setAttribute('stop-color',svgDoc.getElementById('couleurSlideRuleExterne').getElementsByTagName('stop').item(0).getAttribute('stop-color'));
	}
}

function rotateAiguilles(){
	var now=new Date();
	if(currentFunction!=3)
		svgDoc.getElementById('trotteuse').setAttribute('transform','rotate('+(now.getSeconds()/60*360)+',0,0)');
	if(now.getSeconds()==30 || now.getSeconds()==31)
		svgDoc.getElementById('minutes').setAttribute('transform','rotate('+((now.getMinutes()+.5)/60*360)+',0,0)');
	else if(now.getSeconds()==0 || now.getSeconds()==1){
		svgDoc.getElementById('minutes').setAttribute('transform','rotate('+(now.getMinutes()/60*360)+',0,0)');
		svgDoc.getElementById('heures').setAttribute('transform','rotate('+((now.getHours()+now.getMinutes()/60)/12*360)+',0,0)');
	}else if(currentFunction==0){
	//	if(now.getHours()!=24)
	//		var str=(now.getHours())<10?'0'+(now.getHours())+':':(now.getHours())+':';
	//	else
	//		var str="00:";
		var str=(now.getHours())<10?'0'+(now.getHours())+':':(now.getHours())+':';
		str+=now.getMinutes()<10?'0'+now.getMinutes()+':':now.getMinutes()+':';
		str+=now.getSeconds()<10?'0'+now.getSeconds():now.getSeconds();
		var disp2=svgDoc.createTextNode(str);
		svgDoc.getElementById('digital2').replaceChild(disp2,svgDoc.getElementById('digital2').firstChild);
	}else if(currentFunction==2){
		var str=' '+now.getYear();
		str=str.substring(2);
		str=(now.getMonth()+1)<10?'0'+(now.getMonth()+1)+'.'+str:(now.getMonth()+1)+'.'+str;
		str=now.getDate()<10?'0'+now.getDate()+'.'+str:now.getDate()+'.'+str;
		var disp2=svgDoc.createTextNode(str);
		svgDoc.getElementById('digital2').replaceChild(disp2,svgDoc.getElementById('digital2').firstChild);
	}else if(currentFunction==5){
		if(now.getHours()-TZOffset!=24)
			var str=(now.getHours()-TZOffset)<10?'0'+(now.getHours()-TZOffset)+':':(now.getHours()-TZOffset)+':';
		else
			var str="00:";
		str+=now.getMinutes()<10?'0'+now.getMinutes()+':':now.getMinutes()+':';
		str+=now.getSeconds()<10?'0'+now.getSeconds():now.getSeconds();
		var disp2=svgDoc.createTextNode(str);
		svgDoc.getElementById('digital2').replaceChild(disp2,svgDoc.getElementById('digital2').firstChild);
	}else if(currentFunction==7){
		if(now.getHours()-UTCOffset!=24)
			var str=(now.getHours()-UTCOffset)<10?'0'+(now.getHours()-UTCOffset)+':':(now.getHours()-UTCOffset)+':';
		else
			var str="00:";
		str+=now.getMinutes()<10?'0'+now.getMinutes()+':':now.getMinutes()+':';
		str+=now.getSeconds()<10?'0'+now.getSeconds():now.getSeconds();
		var disp2=svgDoc.createTextNode(str);
		svgDoc.getElementById('digital2').replaceChild(disp2,svgDoc.getElementById('digital2').firstChild);
	}

	setTimeout("rotateAiguilles()",1000);
}

function showNo() {
	var originalDisplay = svgDoc.getElementById('digital1').innerHTML;
	svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('NO'),svgDoc.getElementById('digital1').firstChild);
	setTimeout(function(originalDisplay) { svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode(originalDisplay),svgDoc.getElementById('digital1').firstChild); }, 1000, originalDisplay);
}

function changeFunction(){
	svgDoc.getElementById('antiBugCadran').setAttribute('visibility','visible');
	currentFunction++;
	if(currentFunction>functions.length-1)
		currentFunction=0;

	if(currentFunction==0){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('TIME'),svgDoc.getElementById('digital1').firstChild);
	}else if(currentFunction==1){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('AL'),svgDoc.getElementById('digital1').firstChild);
		svgDoc.getElementById('digital2').replaceChild(svgDoc.createTextNode('06:25oF'),svgDoc.getElementById('digital2').firstChild);
	}else if(currentFunction==2){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('DATE'),svgDoc.getElementById('digital1').firstChild);
	}else if(currentFunction==3){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('CHR 00'),svgDoc.getElementById('digital1').firstChild);
		svgDoc.getElementById('digital2').replaceChild(svgDoc.createTextNode('00:00:00'),svgDoc.getElementById('digital2').firstChild);
		svgDoc.getElementById('trotteuse').setAttribute('transform','rotate(0,0,0)');
	}else if(currentFunction==4){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('TM 00'),svgDoc.getElementById('digital1').firstChild);
		svgDoc.getElementById('digital2').replaceChild(svgDoc.createTextNode('00:10:00'),svgDoc.getElementById('digital2').firstChild);
	}else if(currentFunction==5){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('TZ'),svgDoc.getElementById('digital1').firstChild);
	}else if(currentFunction==6){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('AL2'),svgDoc.getElementById('digital1').firstChild);
		svgDoc.getElementById('digital2').replaceChild(svgDoc.createTextNode('07:05oF'),svgDoc.getElementById('digital2').firstChild);
	}else if(currentFunction==7){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode('UTC'),svgDoc.getElementById('digital1').firstChild);
	}else if(currentFunction==8){
		svgDoc.getElementById('digital1').replaceChild(svgDoc.createTextNode(''),svgDoc.getElementById('digital1').firstChild);
		svgDoc.getElementById('digital2').replaceChild(svgDoc.createTextNode(''),svgDoc.getElementById('digital2').firstChild);
	}
	svgDoc.getElementById('antiBugCadran').setAttribute('visibility','hidden');
}

function rotateSlideRule(angle){
	angleLunette+=angle;
	svgDoc.getElementById('lunette').setAttribute('transform','rotate('+angleLunette+',0,0)');
	svgDoc.getElementById('slideRuleExterne').setAttribute('transform','rotate('+(angleLunette*1.2)+',0,0)');
}

function clavier(evt){
	var charCode=String.fromCharCode(evt.getCharCode());
	if(charCode=="q"){
		rotateSlideRule(-1);
	}else if(charCode=="Q"){
		rotateSlideRule(-15);
	}else if(charCode=="d"){
		rotateSlideRule(1);
	}else if(charCode=="D"){
		rotateSlideRule(15);
	}
}

/*  */
